    [],nt"revision_timestamp": "2015-11-25T17:32:30.870250",nt"name": "modelled-precipitation-over-greenland",nt"isopen":
    true,nt"url": null,nt"notes": "This data set includes the annual total
    precipitation from 1985 to 1999 and monthly total precipitation from January 1985
    to December 1999. The data is derived from a dynamic model using the omega equation
    which describes vertical atmospheric motion. The data are arrayed in a 67 x 69 grid
    with a grid length of 50 km.nnTwo versions of the data are available in separate
    directories (ver1 and ver2). Data are in ASCII files named yy.sum for annual total
    precipitation (mm), yymm.sum for monthly total precipitation (mm), and yy1-yy2.mean
    for annual mean precipitation from yy1 to yy2. Latitude and longitude data for the
    grid points and topological data are also available.",nt"license_title": "U.S.
